!function(){var a=$('<div class="module col-lg-12" style="text-align:center;padding:0px;" id="bank">   <div style="margin-bottom:0px;">       <div> <h3 class="bank_name" style="text-align: center"> </h3></div> <div>  <div class="row">   <div class="col-lg-12 col-md-12"><a href="#">      <img class="bank_img" src="" alt="Bank">  </a> <table class="table bank_table" style="text-align: center "></table> </div>   </div>   </div>  </div>')
if(0===$("#bank").length){$("#smart_answer").addClass("hide"),a.find(".bank_name").text(window.SA["main-ans"].name)
var e=""
$.each(window.SA["main-ans"],function(i,t){"name"!==i&&"image source"!==i&&(window.SA.required.join(" ").indexOf(i)>=0?e+='<tr><td class="td_border"><b>'+i.capitalizeMe()+" : "+t+"</b></td></tr> ":a.find(".bank_table").append('<tr><td class="td_border"><b>'+i.capitalizeMe()+"</b> : "+t+"</td></tr> "))}),a.find(".bank_table").prepend(e)
try{a.find(".bank_img").attr("src","http://en.wikipedia.org/wiki/en:Special:Filepath/"+window.SA["main-ans"]["image source"].split("/").pop().replace("File:","")+"?width=250")}catch(i){a.find(".bank_img").attr("src","http://upload.wikimedia.org/wikipedia/commons/1/1b/Seal_of_the_Reserve_Bank_of_India.svg")}$("#smart_col").html(a),$("#smart_col").removeClass("hide")}}()
